import React from 'react';
import { Form, Button } from 'react-bootstrap';
import './../CSS/booking.css';
import About from './About Us';
import Footer from './Contact Us';
import { items } from "./../Stitch/mongodb";

class Booking extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            start: null,
            destiny: null,
            startdate: null,
            return: null,
            quantity: 0,
            dealers: null
        }
        this.handleSubmit = this.handleSubmit.bind(this);
    }

    async componentDidMount() {
        //getting data from db
        var details = await items.find({ "isDealer": true }).toArray();
        //checking if the user details are present  in db or not
        //var ispresent = details.some(item => item.owner_id === curruser.id);
        if (details) {
            //if user details are present then filtering it out to a new array
            //var result = details.filter( item => item.owner_id === curruser.id);
            //setting the state values
            this.setState({
                dealers: details.name
            })
        }
    }


    handleSubmit = (e) => {
        e.preventDefault();
        alert("Submitted Successfully. You'll get an Email soon");
        this.setState({});
    }

    render() {
        return (
            <>
            <div className="containerbooking">
                <h1 className='bookinghead'>Book Your Tickets</h1>
                <p className='bookingp'>Fill your starting point and your Destiny</p>
                <Form onSubmit={this.handleSubmit}>
                    <Form.Row style={{ paddingLeft: '450px' }}>
                        <Form.Group controlId="formBasicStart">
                            <Form.Label style={{ color: 'white', fontFamily: 'Courier', fontWeight: 'bolder'}}>Start</Form.Label>
                            <Form.Control type="text" onChange={e => this.setState({ start: e.target.value })} />
                            <Form.Text className="text-muted">
                            </Form.Text>
                        </Form.Group>&nbsp;&nbsp;&nbsp;&nbsp;   

                        <Form.Group controlId="formBasicDestiny">
                            <Form.Label style={{ color: 'white', fontFamily: 'Courier', fontWeight: 'bolder' }}>Destiny</Form.Label>
                            <Form.Control type="text" onChange={e => this.setState({ destiny: e.target.value })} />
                            <Form.Text className="text-muted">
                            </Form.Text>
                        </Form.Group>
                    </Form.Row>

                    <Form.Row style={{ paddingLeft: '525px' }}>
                        <Form.Group controlId="formBasicStartDate">
                            <Form.Label style={{ color: 'white', fontFamily: 'Courier', fontWeight: 'bolder' }}>Start Date</Form.Label>
                            <Form.Control type="date" onChange={e => this.setState({ startdate: e.target.value })} />
                            <Form.Text className="text-muted">
                            </Form.Text>
                        </Form.Group>&nbsp;&nbsp;&nbsp;&nbsp;

                        <Form.Group controlId="formBasicReturnDate">
                            <Form.Label style={{ color: 'white', fontFamily: 'Courier', fontWeight: 'bolder' }}>Return Date</Form.Label>
                            <Form.Control type="date" onChange={e => this.setState({ return: e.target.value })} />
                            <Form.Text className="text-muted">
                            </Form.Text>
                        </Form.Group>
                    </Form.Row>

                    <Form.Row style={{ paddingLeft: '570px' }} min={1}>
                        <Form.Group controlId="formBasicTickets">
                            <Form.Label style={{ color: 'white', fontFamily: 'Courier', fontWeight: 'bolder' }}>Number Of Tickets</Form.Label>
                            <Form.Control type="number" onChange={e => this.setState({ quantity: e.target.value })} />
                            <Form.Text className="text-muted">
                            </Form.Text>
                        </Form.Group>

                         <Form.Group controlId="formGridState">
                                <Form.Label>State</Form.Label>
                                <Form.Control as="select" value="Choose...">
                                    <option>{this.state.dealers[0]}</option>
                                    <option>...</option>
                                </Form.Control>
                         </Form.Group>


                        </Form.Row>
                        
                        <Button variant="primary" type="submit">
                            Submit
                        </Button>
                </Form>
            </div>
            <About />
            <Footer />
            </>
            );
    }
}

export default Booking;
